DROP TABLE IF EXISTS `pay`;
CREATE TABLE `pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `mathe` varchar(255) NOT NULL DEFAULT '',
  `seri` varchar(255) NOT NULL DEFAULT '',
